import React, { useState, useEffect } from 'react';
import './RoverDetails.css';

function RoverDetails() {
  const [roverData, setRoverData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetch('/api/rover-details')
      .then(response => {
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        return response.json();
      })
      .then(data => {
        setRoverData(data);
        setLoading(false);
      })
      .catch(err => {
        console.error('Fetch error:', err);
        setError(err.message);
        setLoading(false);
      });
  }, []);

  if (loading) return <div className="rover-container">Loading...</div>;
  if (error) return <div className="rover-container" style={{ color: 'red' }}>Error: {error}</div>;

  return (
    <div className="rover-container">
      <header className="header">
        <h1>Rover Details</h1>
        <p>Real-time status and details of your rovers</p>
      </header>
      <section className="rover-content">
        {roverData.length > 0 ? (
          roverData.map((rover, index) => (
            <div className="rover-card" key={rover._id || index}>
              <h2>Rover: {rover.rover_id}</h2>
              <p><strong>Timestamp:</strong> {new Date(rover.timestamp).toLocaleString()}</p>
              <p><strong>Heading:</strong> {rover.heading}°</p>
              <p><strong>Mode:</strong> {rover.mode}</p>
              <p><strong>Armed:</strong> {rover.armed ? 'Yes' : 'No'}</p>
              <p><strong>System Status:</strong> {rover.system_status}</p>
              <h3>GPS</h3>
              <p><strong>Latitude:</strong> {rover.gps?.latitude || 'N/A'}</p>
              <p><strong>Longitude:</strong> {rover.gps?.longitude || 'N/A'}</p>
              <h3>Battery</h3>
              <p><strong>Level:</strong> {rover.battery?.level || 'N/A'}%</p>
              <p><strong>Voltage:</strong> {rover.battery?.voltage || 'N/A'}V</p>
              <h3>Velocity</h3>
              <p><strong>Speed:</strong> {rover.velocity?.speed || 'N/A'} m/s</p>
              <p><strong>Direction:</strong> {rover.velocity?.direction || 'N/A'}°</p>
            </div>
          ))
        ) : (
          <p>No rover data available.</p>
        )}
      </section>
      <footer className="footer">
        <p>© 2025 ParkSense. All rights reserved.</p>
      </footer>
    </div>
  );
}

export default RoverDetails;
